import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <div>
            <footer className="footer">
                <div className="foot1">
                    <p>Made with &#9829; by Manish and Divyanshu</p>
                </div>
            </footer>
        </div>
    );
}
export default Footer;
